import React, { useState } from 'react'
import Register from '../Register'
import ChangePassowrd from '../ChangePassword'
import './index.css'
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

export const RegisterUser = () => {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <React.Fragment>
      <Button variant="outlined" onClick={handleClickOpen}>
        Open alert dialog
      </Button>
      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">
          {"Use Google's location service?"}
        </DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            Let Google help apps determine location. This means sending anonymous
            location data to Google, even when no apps are running.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Disagree</Button>
          <Button onClick={handleClose} autoFocus>
            Agree
          </Button>
        </DialogActions>
      </Dialog>
    </React.Fragment>
  );
}


const Login = () => {
  const [isAccount, setIsAccount] = useState('login')
  const [loginDetails, setLoginDetails] = useState({})

  const haveNoAccount = () => {
    setIsAccount('register')
  }

  const changePassowordHandle = () => {
    setIsAccount('forgetPassword')
  }

  return (
    <>
      {isAccount === 'login' ? (
        <div className='login-container'>
          <div className='main-content-container'>
            <h1 className='main-heading'>Join 8 Million Businesses <br />
              <span className='main-heading-span'>Powering Growth with</span><br />
              Lemonpay!
            </h1>
          </div>
          <form className='form-container'>
            <p className='login-heading'>Welcome Login System</p>
            <div className='input-element-conatiner'>
              <label htmlFor="email" className='label-element'>Email</label>
              <input className='input-element' placeholder='mahadev@lemonpay.tech' type="email" id='email' />
            </div>
            <div className='input-element-conatiner'>
              <label htmlFor="password" className='label-element'>Password</label>
              <input className='input-element' placeholder='Min 8 characters' type='password' id='password' />
            </div>
            <div className='input-element-checkbox-container'>
              <div className='checkbox-container'>
                <input type='checkbox' className='checkbox' id='checkbox' />
                <label className='label-element' htmlFor='checkbox'>Remember me</label>
              </div>
              <>
                <button className='forget-button label-element' type='button' onClick={changePassowordHandle}>Forget password?</button>
              </>
            </div>
            <button type='submit' className='login-button'>Sign in</button>
            <button type='button' className='forget-button register' onClick={haveNoAccount}>If You Don't Have Account ? Register Here</button>
          </form >
        </div >
      ) : isAccount === 'register' ? ( <Register /> ) : ( <ChangePassowrd /> )
      }
    </>
  )
}


export default Login
